;; **
;;; ### Multivariate Normal Query
;; **

;; @@
(with-primitive-procedures [matrix transpose mmul add]
(defquery joint-bulk [vote-results] ; vote-result is 1D list of probabilities.
  (let [n  (count members)
        U  (into [] (repeatedly n (fn [] (sample (uniform-continuous 0.35 0.65))))) ; Random Mean Vector
        a  (into [] (repeatedly n (fn [] (into [] (repeatedly n (fn [] (sample (uniform-continuous -0.05 0.05))))))))
        A  (add (mmul (matrix a) 2) 0.001)
        S  (mmul (transpose A) A)]  ; Random Covariance Matrix (A^T @ A for some random A)
   (observe (mvn U S) vote-results)
   (sample (mvn U S)))))
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-var'>#&#x27;pro1/joint-bulk</span>","value":"#'pro1/joint-bulk"}
;; <=

;; @@
(defn votes-to-probs [vote-results] ; actually I misnamed it; just column-wise sample mean.
    (map (fn [x] (/ x (count vote-results))) (apply map + (map (fn [x] (into [] x)) vote-results))))
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-var'>#&#x27;pro1/votes-to-probs</span>","value":"#'pro1/votes-to-probs"}
;; <=

;; @@
(def key-idx (index-of "염동열" members))

; Encoding
(defn encode-row [vr-row]
  (let [key-choice (nth vr-row key-idx)]
    (map (fn [x] (= key-choice x)) vr-row)))

(def encoded-vote
  (map encode-row (filter
                    (fn [row] (not (= (nth row key-idx) "abs")))
                    (map rest (rest vote_result)))))

(def yeom (filter (fn [x] (not (= "홍문종 "(first x))))
  (let [n_votes (map (fn [y] (map (fn [x] (if x 1 0)) y)) encoded-vote)
        p_votes (votes-to-probs n_votes)
        lazy    (doquery :ipmcmc joint-bulk [p_votes])
        samp    (map :result (take-nth 10 (take 500 (drop 1000  lazy))))
        smean   (votes-to-probs samp)]
   (map vector (filter (fn [x] (not (= x (nth members key-idx)))) members) smean))))
