;;; ### Blind Voting
;; **

;; @@
(defquery blind-joint-bulk [probs target] ; vector of probabilities, and # of pro-votes.
  (let [n  (count members)
        x  (+ 1 (sample (poisson 1)))
        y  (+ 1 (sample (poisson 1)))
        T  (sample (beta x y))            ; Perturbation Variable (*shared across members)
        V  (reduce + (map (fn [p] (if (sample (flip (* T p))) 1 0)) probs))]
    (observe (normal V 1) target)
    T))
